import &#x7B; strict as assert &#x7D; from "assert";
import &#x7B; isEmpty &#x7D; from "ast-is-empty";

assert.equal(
  isEmpty(&#x7B;
    a: "",
  &#x7D;),
  true
);

assert.equal(
  isEmpty(&#x7B;
    a: [""],
    b: &#x7B;
      c: &#x7B;
        d: "",
      &#x7D;,
    &#x7D;,
  &#x7D;),
  true
);

assert.equal(
  isEmpty([
    &#x7B;
      a: [""],
      b: &#x7B; c: &#x7B; d: "" &#x7D; &#x7D;,
    &#x7D;,
    "",
    ["", "", ""],
  ]),
  true
);
